import React from "react";

import COLORS from "../../assets/COLORS.JPG";
import Menu from "../Menu/Menu";

export default class Projects extends React.Component {
  render() {
    return (
      <div className="ContextContainer">
        <Menu />
        <div style={{ height: "2vh" }}>&nbsp;</div>

        {/* ---------- */}
        {/* CONTENT */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div
            className="BaseCard"
            style={{ backgroundImage: "url(" + COLORS + ")" }}
            data-uk-parallax="bgy: -200"
          >
            <h1 data-uk-parallax="y: -200; easing: 0.5" id="CardName">
              projects
            </h1>
          </div>
        </div>

        {/* ---------- */}
        {/* P01 */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div className="BaseCard uk-cover-container">
            <video
              src="https://mega.nz/#!s4QjkSQY!nxFCCO2M2OVfQQ1AfyO7jFz2SSJofwi_wYXtiZls26c"
              autoPlay
              loop
              muted
              playsInline
              data-uk-cover
            />
            <h1
              data-uk-parallax="y: -100; easing: 1"
              id="CardName"
              style={{ left: "-5%" }}
            >
              01 - faltan macbooks
            </h1>
          </div>
        </div>

        {/* ---------- */}
        {/* P02 */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div className="BaseCard uk-cover-container">
            <video
              src="https://www.youtube.com/embed/a9rAYMNuKzM"
              autoPlay
              loop
              muted
              playsInline
              data-uk-cover
            />
            <h1
              data-uk-parallax="y: -100; easing: 1"
              id="CardName"
              style={{ left: "-5%" }}
            >
              01 - faltan macbooks
            </h1>
          </div>
        </div>
      </div>
    );
  }
}
